INSERT INTO `aplikasi` (`id`, `nama_aplikasi`, `judul_aplikasi`, `deskripsi`, `logo`, `email`, `hp`, `alamat`, `salam`, `created_at`, `updated_at`) VALUES
(1, 'Disdik Raja Ampat', 'DINAS PENDIDIKAN RAJA AMPAT', 'Dinas Pendidikan merupakan unsur pelaksana urusan bidang pendidikan yang menjadi kewenangan Daerah yang dipimpin oleh Kepala Dinas Pendidikan', 'file-manager/WtgLqUuvTq4TyyxgsohBzEC6JbcHKzeUPqu47JYX.png', 'test@gmail.com', '0812-2875-4798', 'HRJJ+W2P, Waisai, Distrik Kota Waisai, Kabupaten Raja Ampat, Papua Bar. 98482', '<h4><strong>Assallamualaikum Wr Wb.</strong></h4>\r\n<h4>Salam sejahtera bagi kita semua.</h4>\r\n<p data-start=\"295\" data-end=\"486\">Puji syukur kita panjatkan ke hadirat Tuhan Yang Maha Esa karena atas rahmat dan karunia-Nya, Website Dinas Pendidikan ini dapat hadir sebagai sarana informasi dan komunikasi bagi masyarakat.</p>\r\n<p><img style=\"float: right;\" src=\"https://images.lezen.id/cdn-sikadeka-pilkada.kpu.go.id/1/4/0/pasangan_calon_c0aea1239ff942acbb62b108b0da5ffd.webp\" alt=\"\" width=\"346\" height=\"260\"></p>\r\n<p data-start=\"488\" data-end=\"865\">Website ini diharapkan menjadi media yang efektif, transparan, dan akuntabel dalam menyampaikan berbagai informasi terkait kebijakan, program, serta kegiatan pendidikan di daerah kita. Melalui platform ini, masyarakat dapat mengakses informasi secara cepat, tepat, dan mudah, sehingga dapat meningkatkan partisipasi serta kepercayaan publik terhadap penyelenggaraan pendidikan.</p>\r\n<p data-start=\"867\" data-end=\"1133\">&nbsp;</p>\r\n<p data-start=\"867\" data-end=\"1133\">Saya mengapresiasi Dinas Pendidikan beserta seluruh pihak yang telah berkontribusi&nbsp;dalam pengembangan website ini. Semoga kehadirannya dapat mendukung peningkatan mutu layanan pendidikan dan mewujudkan sumber daya manusia yang unggul, berkarakter, dan berdaya saing.</p>\r\n<p data-start=\"1135\" data-end=\"1278\">Akhir kata, saya mengajak seluruh pemangku kepentingan untuk bersama-sama mendukung kemajuan pendidikan demi masa depan daerah yang lebih baik.</p>\r\n<p data-start=\"1280\" data-end=\"1325\">Wassalamu&rsquo;alaikum warahmatullahi wabarakatuh.</p>', '2026-01-10 00:14:12', '2026-02-06 01:51:17');
