INSERT INTO `pages` (`id`, `title`, `slug`, `content`, `meta_title`, `type`, `handler`, `parent_id`, `active`, `sort_order`, `created_at`, `updated_at`) VALUES
(1, 'Home', 'home', NULL, NULL, 'Pages', 'page', NULL, 1, 1, '2026-01-16 02:24:03', '2026-01-16 21:02:45'),
(4, 'Berita', 'berita', NULL, NULL, 'Pages', 'page', NULL, 1, 2, '2026-01-16 20:15:55', '2026-02-03 02:21:30'),
(15, 'Kategori', 'kategori', NULL, NULL, 'Pages', 'page', NULL, 1, 2, '2026-01-16 21:46:08', '2026-01-30 10:38:58'),
