(17, 'Profil', 'profil', NULL, NULL, 'Pages', 'page', NULL, 1, 5, '2026-01-16 21:47:01', '2026-02-03 02:21:04'),
(18, 'Sejarah', 'sejarah', '<p>Proses kelahiran Kabupaten Raja Ampat secara yuridis formal dapat dikaji berdasarkan Penjelasan Atas Undang-Undang Nomor 13 Tahun 2009 tentang Pembentukan Kabupaten Raja Ampat di Provinsi Papua Barat, pada bagian I. Umum.&nbsp;Kemudian kita patut bersyukur kepada Tuhan Yang Maha Kuasa, bahwa Tahun 2009 merupakan momentum yang sangat penting dan bersejarah bagi rakyat Raja Ampat, karena perjuangan yang cukup panjang dari tahun 2001, maka pada akhirnya ditentukan Undang-Undang Nomor 13 Tahun 2009 tanggal 16 Januari 2009 tentang Pembentukan Kabupaten Raja Ampat di Provinsi Papua Barat,</p>\r\n<p>Dengan terbentuknya Kabupaten Raja Ampat ini, maka OPD Dinas Pendididkan dan Kebudayaan Kabupaten Raja Ampat terbentuk</p>', NULL, 'Sub Pages', 'page', 17, 1, 1, '2026-01-16 21:47:23', '2026-01-27 08:51:47'),
(19, 'Visi Misi', 'visi-misi', '<p><strong>VISI</strong></p>\r\n<p><strong>&nbsp;</strong><strong><em>&ldquo;Membangun Sumber Daya Manusia yang berkualitas, berkepribadian luhur, mandiri dan mampu mengatasi&nbsp;&nbsp;</em></strong><strong><em>tantangan serta aset pembangunan daerah&rdquo;</em></strong></p>\r\n<p><strong>MISI</strong></p>\r\n<p><strong>Misi 1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>: meningkatkan pemerataan dan perluasan kesempatan memperoleh pendidikan.</p>\r\n<p><strong>Tujuan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>: Meningkatkan pelayanan pendidikan pada semua jenjang dan jenis pendidikan.</p>\r\n<p><strong>Sasaran</strong>&nbsp; &nbsp; &nbsp; &nbsp; :</p>\r\n<ul>\r\n<li>Penyediaan tanah untuk pembangunan USB TK, SD, SMP, SMA, SMK dan Perguruan Tinggi.</li>\r\n<li>Pembangunan RKB Lengkap meubelair.</li>\r\n<li>Pendirian akademi, sekolah tinggi, universitas dengan jurusan yang relevan dengan potensi / hubungan daerah serta pembangunan daerah.</li>\r\n<li>Pembangunan sekolah berpola asrama dan atau mahasiswa Raja Ampat di dalam dan di luar Provinsi Papua dan Papua Barat.</li>\r\n</ul>\r\n<p><strong>Misi 2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>: Meningkatkan mutu pendidikan pada semua jenjang dan jenis pendidikan</p>\r\n<p><strong>Tujuan</strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : Meningkatkan kualitas lulusan pada semia jenjang dan jkenis pendidikan</p>\r\n<p><strong>Sasaran</strong>&nbsp; &nbsp; &nbsp; &nbsp; :</p>\r\n<ul>\r\n<li>Meningkatkan kemampuan Kepala TK, SD SMP, SMA / SMK sebagai pemimpin dan manajer</li>\r\n<li>Meningkatkan kemampuan guru dan tenaga kependidikan dalam kurikulum tingkat satuan pendidikan</li>\r\n<li>Meningkatkan kemampuan mengajar guru TK, SD, SMP, SMA / SMK</li>\r\n<li>Meningkatkan kemampuan pengelola perpustakaan sekolah, lab sekolah dan lab komputer sekolah</li>\r\n<li>Meningkatkan kemampuan guru dalam penggunaan alat-alat pengolah pada TK, SD, SMP, SMA / SMK.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Misi 3&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong>&nbsp;: Meningkatkan relevansi pendidikan sesuai dengan kebutuhan pembangunan daerah.</p>\r\n<p><strong>Tujuan</strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : Meningkatkan keterkaitan dan kesepadanan (LINK dan MATCH) antara pendidikan dengan dunia&nbsp; usaha dan industri serta kebutuhan pembangunan daerah</p>\r\n<p><strong>Sasaran&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong>:</p>\r\n<ul>\r\n<li>Pembangunan USB SMK Kelautan dan Perikanan, Pertanian, Pertambangan, Industri dan Kerajinan</li>\r\n<li>Penambahan jurusan baru pada sekolah tinggi dengan program studi yang sesuai dengan potensi wilayah / wilayah serta pembangunan daerah</li>\r\n<li>Penambahan RKB pada SMK Negeri Samate dan SMK Negeri Waisai</li>\r\n<li>Penyempurnaan Tingkat Satuan Pendidikan dengan kurikulum yang lebih esensial dan bermuatan local (life skill)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Misi 4</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Meningkatkan kemampuan bahasa Inggris bagi siswa dan guru serta tenaga kependidikan</p>\r\n<p><strong>Tujuan</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : meningkatkan kemampuan berbahasa Inggris siswa dan guru pada berbagai jenjang satuan pendidikan di Raja Ampat dan bahasa Inggris sebagai bahasa pengantar kedua sekolah</p>\r\n<p><strong>Sasaran &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>:</p>\r\n<ul>\r\n<li>Kerja sama dengan perguruan tinggi negeri dan swasta untuk magang guru bahasa Inggris di dalam dan diluar negeri</li>\r\n<li>Pengadaan kamus dan buku bahasa Inggris serta kaset SD untuk sekolah-sekolah</li>\r\n<li>Peningkatan kegiatan MGMP guru bahasa Inggris</li>\r\n<li>Penetapan mata pelajaran bahasa Inggris sebagai mata pelajaran yang di ajarkan di SD mulai dari kelas III</li>\r\n<li>Penetapan sehari dalam seminggu untuk berbahasa Inggris di sekolah-sekolah</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Misi 5</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Meningkatakn kesejahteraan guru, tenaga kependidikan, tata usaha dan penjaga sekolah</p>\r\n<p><strong>Tujuan</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Meningkatkan kesejahteraan guru, tenaga kependidikan, tata usaha dan penjaga sekolah melalui pembangunan rumah dinas</p>\r\n<p><strong>Sasaran&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>:</p>\r\n<ul>\r\n<li>Meningkatkan kesejahteraan guru, tenaga kependidikan, tata usaha dan penjaga sekolah melalui pembangunan rumah dinas</li>\r\n<li>Pembayaran gaji dan tunjangan kinerja daerah tepat waktu</li>\r\n<li>Pengadaan pakaian dinas guru / kepala sekolah, tenaga kependidikan, tata usaha dan penjaga sekolah</li>\r\n<li>Pengusulan kenaikan pangkat tepat waktu</li>\r\n<li>Koperasi Pendirian Kofarkor</li>\r\n<li>Pendirian organisasi PGRI dan Dewan pendidikan dalam memperjuangkan hak-hak guru.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Misi 6</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Meningkatkan pelayanan pendidikan masyarakat</p>\r\n<p><strong>Tujuan</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Menigkatkan pelayanan pendidikan bagi masyarakat melalui pendidikan non formal</p>\r\n<p><strong>Sasaran</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :</p>\r\n<ul>\r\n<li>Kejar Paket A setara SD, Paket B setara SMP dan Paket C setara SMA</li>\r\n<li>Pemberantasan buta huruf masyarakat usia 10-44 tahun melalui pemberantasan buta aksara fungsional</li>\r\n<li>Pengadaan buku / modul PBAF, Paket A, Paket B, Paket C serta tenaga tutor PAUD</li>\r\n<li>Penyediaan dana dan sarana prasarana PAUD</li>\r\n</ul>', NULL, 'Sub Pages', 'page', 17, 1, 2, '2026-01-16 21:48:35', '2026-01-30 10:59:21'),
(20, 'Tupoksi', 'tupoksi', '<p>Tugas Pokok, Fungsi, dan Tata Kerja Unsur Organisasi Dinas Pendidikan Kabupaten Raja Ampat diatur melalui Peraturan Bupati Raja Ampat Nomor Tahun tentang Tugas Fungsi dan Tata Kerja Unsur Organisasi Dinas Pendidikan., Sebagai berikut:</p>\r\n<p><strong>KEPALA DINAS</strong></p>\r\n<ul>\r\n<li>Kepala Dinas Pendidikan tugas membantu Bupati melaksanakan pemerintahan bidang pendidikan yang kewenangan Daerah dan Tugas Pembantuan yang diberikan kepada Daerah sesuai bidang tugasnya.</li>\r\n<li>Kepala Dinas Pendidikan dalam melaksanakan tugas sebagaimanadimaksud pada ayat (1) menyelenggarakan fungsi:</li>\r\n</ul>\r\n<ol>\r\n<li>Perumusan kebijakan penyelenggaraan urusan pendidikan termasuk manajemen pendidikan, kurikulum, pendidik dan tenaga kependidikan, perizinan pendidikan, bahasa dan sastra yang penuturnya dalam Daerah sesuai dengan lingkup tugasnya;</li>\r\n<li>Pelaksanaan kebijakan urusan urusan pendidikan yang meliputibidang manajemen pendidikan, kurikulum, pendidik dan tenaga kependidikan, perizinan pendidikan, bahasa dan sastra yang penuturnya dalam Daerah sesuai dengan lingkup tugasnya;</li>\r\n<li>pelaksanaan evaluasi dan pelaporan sesuai dengan lingkup tugasnya;</li>\r\n<li>pelaksanaan administrasi dinas sesuai dengan lingkup tugasnya;&nbsp;dan</li>\r\n<li>pelaksanaan fungsi lain yang diberikan oleh Bupati terkait dengan tugas danfungsinya.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>SEKRETARIS</strong></p>\r\n<ul>\r\n<li>Sekretariat dipimpin oleh Sekretaris berada di bawah dan bertanggung jawab kepada Kepala Dinas.</li>\r\n<li>Sekretariat dimaksud pada ayat (1) mempunyai tugas menyelenggarakan perencanaan koordinasi dan program Dinas, pengkajian perencanaan dan program, serta pengelolaan keuangan, kepegawaian dan umum.</li>\r\n<li>Sekretariat dalam melaksanakan tugas sebagaimana dimaksud pada ayat (2) menyelenggarakan fungsi:</li>\r\n</ul>\r\n<ol>\r\n<li>penyelenggaraan pengkajian dan koordinasi perencanaan, program kerja Dinas;</li>\r\n<li>penyelenggaraan pengkajian perencanaan dan program kesekretariatan;</li>\r\n<li>penyelenggaraan pengkajian dan koordinasi pengelolaan data dan informasi, monitoring, evaluasi dan pelaporan kinerja Dinas;</li>\r\n<li>penyelenggaraan pengelolaan administrasi keuangan;</li>\r\n<li>penyelenggaraan pengkajian anggaran belanja;</li>\r\n<li>penyelenggaraan pengendalian administrasi belanja;</li>\r\n<li>penyelenggaraan pengelolaan aset/barang milik daerah;</li>\r\n<li>penyelenggaraan pengelolaan administrasi kepegawaian;</li>\r\n<li>penyelenggaraan penatausahaan, kelembagaan dan ketatalaksanaan;</li>\r\n<li>penyelenggaraan pengelolaan urusan rumah tangga dan perlengkapan;</li>\r\n<li>penyelenggaraanpenyusunanbahanrancangan pendokumentasian perundang-undangan, pengelolaan perpustakaan, protokol dan hubungan masyarakat;</li>\r\n<li>penyelenggaraan pengelolaan naskah dinas dan kearsipan;penyelenggaraan koordinasi dengan unit kerja terkait;</li>\r\n<li>penyusunan laporan kegiatan di bidang tugasnya; dan</li>\r\n<li>pelaksanaan fungsi lain yang diberikan oleh pimpinan terkait dengan tugasdan fungsinya.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"3\">\r\n<li><strong>Sub Bagian Kepegawaian dan Umum</strong></li>\r\n</ol>\r\n<ul>\r\n<li>Sub Bagian Umum dan Kepegawaian dipimpin oleh Kepala Sub Bagian berada di bawah dan bertanggung jawab kepada Sekretaris.</li>\r\n<li>Sub Bagian Umum dan Kepegawaian sebagaimana dimaksud pada ayat mempunyai tugas melaksanakan penyiapan dan koordinasi tatalaksana, kepegawaian dan dukungan administrasi umum yang menjadi tanggung jawab Dinas.</li>\r\n<li>Sub Bagian Umum dan Kepegawaian dalam melaksanakan tugas sebagaimana dimaksud pada ayat (2) menyelenggarakan fungsi:</li>\r\n</ul>\r\n<ol>\r\n<li>penyusunan bahan penyelenggaraan mutasi, pengembangan karir, kesejahteraan dan disiplin pegawai, dan pengelolaan administrasi kepegawaian lainnya;</li>\r\n<li>penyusunan bahan penyelenggaraan pembinaan kelembagaan, ketatalaksanaan dan rumah tangga;</li>\r\n<li>pelaksanaan administrasi, dokumentasi peraturan perundang-undangan, kearsipan dan perpustakaan;</li>\r\n<li>pengelolaan perlengkapan Dinas;</li>\r\n<li>pelaksanaan pengelolaan rumah tangga, ketertiban, keindahan serta keamanan kantor;</li>\r\n<li>pelaksanaan penyusunan rencana kebutuhan sarana dan prasarana, pengurusan rumah tangga, pemeliharaan/perawatan lingkungan kantor, kendaraan dan aset lainnya serta ketertiban, keindahan dan keamanan kantor;</li>\r\n<li>pelaksanaan koordinasi dengan unit kerja terkait;</li>\r\n<li>penyusunan laporan kegiatan di bidang tugasnya; dan</li>\r\n<li>pelaksanaan fungsi lain yang diberikan oleh pimpinan terkait dengan tugas dan fungsinya.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"4\">\r\n<li><strong>Sub Bagian Keuangan</strong></li>\r\n</ol>\r\n<ul>\r\n<li>Sub Bagian Keuangan dipimpin oleh Kepala Sub Bagian berada di bawah dan bertanggung jawab kepada Sekretaris.</li>\r\n<li>Sub Bagian Keuangan sebagaimana dimaksud pada ayat (1) mempunyai tugas melaksanakan pengelolaan dan koordinasi penyelenggaraan urusan keuangan dan pengelolaan aset/barang milik daerah di lingkungan Dinas.</li>\r\n<li>Sub Bagian Keuangan dalam melaksanakan tugas sebagaimana dimaksud pada ayat (2) menyelenggarakan fungsi:</li>\r\n</ul>\r\n<ol>\r\n<li>pelaksanaan penyusunan bahan dan penyiapan anggaran Dinas;</li>\r\n<li>pelaksanaan pengadministrasian dan pembukuan keuangan Dinas;</li>\r\n<li>pelaksanaan perbendaharaan keuangan;</li>\r\n<li>pelaksanaan penyiapan bahan pembinaan administrasi keuangan;</li>\r\n<li>pelaksanaan penatausahaan belanja langsung dan belanja tidak langsung</li>\r\n<li>Dinas dan UPT;</li>\r\n<li>pelaksanaan verifikasi keuangan;</li>\r\n<li>pelaksanaan akuntansi dan penyiapan bahan pertanggung jawaban keuangan;</li>\r\n<li>pelaksanaan dan koordinasi penyusunan bahan evaluasi dan pelaporan administrasi keuangan;</li>\r\n<li>penyusunan laporan pertanggungjawaban pengelolaan keuangan;</li>\r\n<li>pengelolaan aset/barang milik daerah di lingkungan Dinas;</li>\r\n<li>pelaksanaan koordinasi dengan unit kerja terkait;</li>\r\n<li>penyusunan laporan kegiatan di bidang tugasnya; dan</li>\r\n<li>pelaksanaan fungsi lain yang diberikan oleh pimpinan terkait dengan tugas dan fungsinya.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"5\">\r\n<li><strong>Sub Bagian Perencanaan</strong></li>\r\n</ol>\r\n<ul>\r\n<li>Sub Bagian Perencanaan dipimpin oleh Kepala Sub Bagian berada di bawah danbertanggung jawab kepada Sekretaris.</li>\r\n<li>Sub Bagian Perencanaan sebagaimana dimaksud pada ayat (1) mempunyai tugas penyiapan dan koordinasi penyusunan perencanaan, program dan informasi serta penatalaksanaan hubungan masyarakat di lingkungan Dinas.</li>\r\n<li>Sub Bagian Perencanaan dalam melaksanakan tugas sebagaimana dimaksud pada ayat (2) menyelenggarakan fungsi:</li>\r\n</ul>\r\n<ol>\r\n<li>pelaksanaan koordinasi dan penyusunan perencanaan dan program kerja Dinas;</li>\r\n<li>penyiapan, penyusunan, dan analisis bahan rencana perumusan kebijakan,program, dan kegiatan;</li>\r\n<li>penyiapan, pengumpulan, penyusunan, dan analisis bahan rencana anggaran;</li>\r\n<li>pengumpulan, pengolahan, analisis data hasil pemantauan pelaksanaan program, kegiatan, dan anggaran;</li>\r\n<li>pelaksanaan evaluasi dan pelaporan kinerja, program, kegiatan, dan anggaran;</li>\r\n<li>pelaksanaan kegiatan kehumasan dan keprotokolan meliputi pelaksanaan publikasi, dokumentasi, urusan pemberitaan, hubungan media, dan hubungan antar lembaga;</li>\r\n<li>pelaksanaan koordinasi dengan unit kerja terkait;</li>\r\n<li>penyusunan laporan kegiatan di bidang tugasnya; dan</li>\r\n<li>pelaksanaan fungsi lain yang diberikan oleh pimpinan terkait dengan tugas dan fungsinya.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"6\">\r\n<li><strong>Kepala Bidang Pendidikan Dasar</strong></li>\r\n</ol>\r\n<ul>\r\n<li>Bidang Pembinaan&nbsp; Sekolah&nbsp; Dasar&nbsp; dipimpin&nbsp; oleh&nbsp; Kepala&nbsp; Bidang berada di bawah dan bertanggung jawab kepada Kepala Dinas.</li>\r\n<li>Bidang Pembinaan Sekolah Dasar sebagaimana dimaksud pada ayat (1) mempunyai tugas melaksanakan penyusunan bahan perumusan dan pelaksanaan kebijakan di bidang pembinaan sekolah dasar.</li>\r\n<li>Bidang Pembinaan Sekolah Dasar dalam melaksanakan tugas dimaksud padaayat (2) menyelenggarakan fungsi:</li>\r\n</ul>\r\n<ol>\r\n<li>penyusunan bahan perumusan dan koordinasi pelaksanaan kebijakan di bidang kurikulum dan penilaian, kelembagaan dan sarana prasarana, serta peserta didik dan pembangunan karakter sekolah dasar;</li>\r\n<li>pembinaan pelaksanaan kebijakan di bidang kurikulum dan penilaian, kelembagaan dan sarana prasarana, serta peserta didik dan pembangunan karakter sekolah dasar;</li>\r\n<li>penyusunan bahan penetapan kurikulum muatan lokal sekolah dasar;</li>\r\n<li>penyusunan bahan penerbitan izin pendirian, penataan, dan penutupan sekolah dasar;</li>\r\n<li>penyusunan bahan pembinaan kurikulum dan penilaian, kelembagaan dan sarana prasarana, serta peserta didik dan pembangunan karakter sekolah dasar;</li>\r\n<li>penyusunan bahan pembinaan bahasa dan sastra daerah yang penuturnya dalam daerah kabupaten/kota; pelaksanaan pemantauan dan evaluasi di bidang kurikulum dan penilaian, kelembagaan dan sarana prasarana, serta peserta didik dan pembangunan karakter sekolah dasar;</li>\r\n<li>pelaporan di bidang kurikulum dan penilaian, kelembagaan dan sarana prasarana, serta peserta didik dan pembangunan karakter sekolah dasar;</li>\r\n<li>pelaksanaan koordinasi dengan unit kerja terkait;</li>\r\n<li>penyusunan laporan hasil pelaksanaan tugasnya; dan</li>\r\n<li>pelaksanaan fungsi lain yang diberikan oleh pimpinan terkait dengan tugasdan fungsinya.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"7\">\r\n<li><strong>Seksi Kurikulum</strong></li>\r\n</ol>\r\n<ul>\r\n<li>Seksi Kurikulum dan Penilaian Sekolah Dasar dipimpin oleh Kepala Seksi berada dibawah dan bertanggung jawab kepada Kepala Bidang Pembinaan Sekolah Dasar.</li>\r\n<li>Seksi Kurikulum sebagaimana dimaksud pada ayat mempunyai tugas menyiapkan, merumuskan, mengkoordinasikan dan melaksanakan kebijakan kurikulum dan penilaian sekolah dasar.</li>\r\n<li>Seksi Kurikulum dan Penilaian Sekolah Dasar dalam melaksanakan tugas sebagaimana dimaksud pada ayat (2) menyelenggarakan fungsi:</li>\r\n</ul>\r\n<ol>\r\n<li>penyusunan bahan perumusan, koordinasi pelaksanaan kebijakan kurikulum dan penilaian sekolah dasar;</li>\r\n<li>penyusunan bahan penetapan kurikulum muatan lokal dan kriteria penilaian sekolah dasar;</li>\r\n<li>penyusunan bahan pembinaan pelaksanaan kurikulum dan penilaian sekolah dasar;</li>\r\n<li>penyusunan bahan pemantauan dan evaluasi pelaksanaan kurikulum dan penilaian sekolah dasar;</li>\r\n<li>pelaporan di bidang kurikulum dan penilaian sekolah dasar;</li>\r\n<li>pelaksanaan koordinasi dengan unit kerja terkait;</li>\r\n<li>penyusunan laporan hasil pelaksanaan tugasnya; dan</li>\r\n<li>pelaksanaan fungsi lain yang diberikan oleh pimpinan terkait dengan tugas dan fungsinya.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"8\">\r\n<li><strong>Seksi Sarana Prasarana Sekolah Dasar</strong></li>\r\n</ol>\r\n<ul>\r\n<li>Seksi Kelembagaan dan Sarana Prasarana Sekolah Dasar dipimpin oleh Kepala Seksi berada dibawah dan bertanggung jawab kepada Kepala Bidang Pembinaan Sekolah Dasar.</li>\r\n<li>Seksi Kelembagaan dan Sarana Prasarana Sekolah Dasar sebagaimana dimaksud pada ayat (1) mempunyai tugas menyiapkan, merumuskan, mengkoordinasikan dan melaksanakan kebijakan kelembagaan, sarana, dan prasarana sekolah dasar.</li>\r\n<li>Seksi Kelembagaan dan Sarana Prasarana Sekolah Dasar dalam melaksanakan tugas sebagaimana dimaksud pada ayat (2) menyelenggarakan fungsi:</li>\r\n</ul>\r\n<ol>\r\n<li>penyusunan bahan perumusan, koordinasi pelaksanaan kebijakan kelembagaan, sarana, dan prasarana sekolah dasar;</li>\r\n<li>penyusunan bahan pembinaan kelembagaan, sarana, dan prasarana sekolah dasar;</li>\r\n<li>penyusunan bahan penerbitan izin pendirian, penataan, dan penutupan sekolah dasar;</li>\r\n<li>penyusunan bahan pemantauan dan evaluasi kelembagaan, sarana, dan prasarana sekolah dasar;</li>\r\n<li>pelaporan di bidang kelembagaan dan sarana prasarana sekolah dasar;</li>\r\n<li>pelaksanaan koordinasi dengan unit kerja terkait;</li>\r\n<li>penyusunan laporan di bidang tugasnya; dan</li>\r\n<li>pelaksanaan fungsi lain yang diberikan oleh pimpinan terkait dengan tugas dan fungsinya.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"10\">\r\n<li><strong>Bidang Pembinaan Sekolah Menengah Pertama</strong></li>\r\n</ol>\r\n<ul>\r\n<li>Bidang Pembinaan Sekolah Menengah Pertama dipimpin oleh Kepala Bidang berada di bawah dan bertanggung jawab kepada Kepala Dinas.</li>\r\n<li>Bidang Pembinaan Sekolah Menengah Pertama sebagaimana dimaksud pada ayat (1) mempunyai tugas melaksanakan penyusunan bahan perumusan dan pelaksanaan kebijakan di bidang pembinaan sekolah menengah pertama.</li>\r\n<li>Bidang Pembinaan Sekolah Menengah Pertama dalam melaksanakan tugas sebagaimana dimaksud pada ayat (2) menyelenggarakan fungsi:</li>\r\n</ul>\r\n<ol>\r\n<li>penyusunan bahan perumusan dan koordinasi pelaksanaan kebijakan dibidang kurikulum dan penilaian, kelembagaan dan sarana prasarana, serta peserta didik dan pembangunan karakter sekolah menengah pertama;</li>\r\n<li>pembinaan pelaksanaan kebijakan di bidang kurikulum dan penilaian, kelembagaan dan sarana prasarana, serta peserta didik dan pembangunan karakter sekolah menengah pertama;</li>\r\n<li>penyusunan bahan penetapan kurikulum muatan lokal sekolah menengah pertama;</li>\r\n<li>penyusunan bahan penerbitan izin pendirian, penataan, dan penutupan sekolah menengah pertama;</li>\r\n<li>penyusunan bahan pembinaan pelaksanaan kurikulum dan penilaian, kelembagaan dan sarana prasarana, serta peserta didik dan pembangunan karakter sekolah menengah pertama;</li>\r\n<li>pelaksanaan pemantauan dan evaluasi di bidang kurikulum dan penilaian, kelembagaan dan sarana prasarana, serta peserta didik dan pembangunan karakter sekolah menengah pertama;</li>\r\n<li>pelaporan di bidang kurikulum dan penilaian, kelembagaan dan sarana prasarana, serta peserta didik dan pembangunan karakter sekolah menengah pertama;</li>\r\n<li>pelaksanaan koordinasi dengan unit kerja terkait;</li>\r\n<li>penyusunan laporan hasil pelaksanaan tugas bidang pendidikan dasar; dan pelaksanaan fungsi lain yang diberikan oleh pimpinan terkait dengan tugas dan fungsinya.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"11\">\r\n<li><strong>Seksi Kurikulum&nbsp;</strong><strong>Sekolah Menengah Pertama</strong></li>\r\n</ol>\r\n<ul>\r\n<li>Seksi Kurikulum dan Penilaian Sekolah Menengah Pertama dipimpin oleh Kepala Seksi yang berada di bawah dan bertanggung jawab kepada Kepala Bidang Pembinaan Sekolah Menengah Pertama.</li>\r\n<li>Seksi Kurikulum dan Penilaian Sekolah Menengah Pertama sebagaimana dimaksud pada ayat (1) mempunyai tugas menyiapkan, merumuskan, mengkoordinasikan dan melaksanakan kebijakan kurikulum dan penilaian sekolah menengah pertama.</li>\r\n<li>Seksi Kurikulum dan Penilaian Sekolah Menengah Pertama dalam melaksanakan tugas dimaksud pada ayat (2) menyelenggarakan fungsi:</li>\r\n</ul>\r\n<ol>\r\n<li>penyusunan bahan perumusan, koordinasi pelaksanaan kebijakan kurikulum dan penilaian sekolah menengah pertama;</li>\r\n<li>penyusunan bahan penetapan kurikulum muatan lokal dan kriteria penilaian sekolah menengah pertama;</li>\r\n<li>penyusunan bahan pembinaan pelaksanaan kurikulum dan penilaian sekolah menengah pertama;</li>\r\n<li>penyusunan bahan pemantauan dan evaluasi pelaksanaan kurikulum dan penilaian sekolah menengah pertama;</li>\r\n<li>pelaporan di bidang kurikulum dan penilaian sekolah menengah pertama; pelaksanaan koordinasi dengan unit kerja terkait;</li>\r\n<li>penyusunan laporan hasil pelaksanaan tugasnya; dan</li>\r\n<li>pelaksanaan fungsi lain yang diberikan oleh pimpinan terkait dengan tugas dan fungsinya.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"12\">\r\n<li><strong>Seksi dan&nbsp; Sarana&nbsp; Prasarana&nbsp; Sekolah&nbsp; Menengah Pertama</strong></li>\r\n</ol>\r\n<ul>\r\n<li>Seksi Kelembagaan dan Sarana Prasarana Sekolah Menengah Pertama dipimpin oleh Kepala Seksi berada dibawah dan bertanggung jawab kepada Kepala Bidang Pembinaan Sekolah Menengah Pertama.</li>\r\n<li>Seksi Kelembagaan dan Sarana Prasarana Sekolah Menengah Pertama sebagaimana dimaksud pada ayat (1) mempunyai tugas menyusun menyiapkan, merumuskan, mengkoordinasikan dan melaksanakan kebijakan kelembagaan dan sarana prasarana sekolah menengah pertama.</li>\r\n<li>Seksi Kelembagaan dan Sarana Prasarana Sekolah Menengah Pertama dalam melaksanakan tugas dimaksud pada ayat (2) menyelenggarakan fungsi:</li>\r\n</ul>\r\n<ol>\r\n<li>penyusunan bahan perumusan, koordinasi pelaksanaan kebijakan kelembagaan dan sarana prasarana sekolah menengah pertama;</li>\r\n<li>penyusunan bahan pembinaan kelembagaan dan sarana prasarana sekolah menengah pertama;</li>\r\n<li>penyusunan bahan penerbitan izin pendirian, penataan, dan penutupan satuan sekolah menengah pertama;</li>\r\n<li>penyusunan bahan pemantauan dan evaluasi kelembagaan dan sarana prasarana sekolah menengah pertama;</li>\r\n<li>pelaporan di bidang kelembagaan dan sarana prasarana sekolah menengah pertama;</li>\r\n<li>pelaksanaan koordinasi dengan unit kerja terkait;</li>\r\n<li>penyusunan laporan di bidang tugasnya; dan</li>\r\n<li>pelaksanaan fungsi lain yang diberikan oleh pimpinan terkait dengan tugas dan fungsinya.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"14\">\r\n<li><strong>Bidang Pendidikan Anak Usia Dini dan Pendidikan Non Formal</strong></li>\r\n</ol>\r\n<ul>\r\n<li>Bidang Pendidikan Anak Usia Dini dan Pendidikan Non Formal dipimpin oleh Kepala Bidang berada dibawah dan bertanggung jawab kepada Kepala Dinas.</li>\r\n<li>Bidang Pendidikan Anak Usia Dini dan Pendidikan Non Formal sebagaimana dimaksud pada ayat (1) mempunyai tugas melaksanakan penyusunan bahan perumusan dan pelaksanaan kebijakan di bidang pembinaan pendidikan anak usia dini dan pendidikan non formal.</li>\r\n<li>Bidang Pendidikan Anak Usia Dini dan Pendidikan Non Formal dalam melaksanakan tugas sebagaimana dimaksud pada ayat (2) menyelenggarakan fungsi:</li>\r\n</ul>\r\n<ol>\r\n<li>penyusunan bahan perumusan dan koordinasi pelaksanaan kebijakan di bidang kurikulum dan penilaian, kelembagaan dan sarana prasarana, serta peserta didik dan pembangunan karakter11 pendidikan anak usia dini dan pendidikan non formal;</li>\r\n<li>pembinaan pelaksanaan kebijakan di bidang kurikulum dan penilaian, kelembagaan dan sarana prasarana, serta peserta didik dan pembangunan karakter pendidikan anak usia dini dan pendidikan non formal;</li>\r\n<li>penyusunan bahan penetapan kurikulum muatan lokal pendidikan nonformal;</li>\r\n<li>penyusunan bahan penerbitan izin pendirian, penataan, dan penutupan satuan pendidikan anak usia dini dan pendidikan non formal;</li>\r\n<li>penyusunan bahan pembinaan kurikulum dan penilaian, kelembagaan dan sarana prasarana, serta peserta didik dan pembangunan karakter pendidikan anak usia dini dan pendidikan non formal;</li>\r\n<li>pelaksanaan pemantauan dan evaluasi di bidang kurikulum dan penilaian, kelembagaan dan sarana prasarana, serta peserta didik dan pembangunan karakter pendidikan anak usia dini dan pendidikan non formal;</li>\r\n<li>pelaporan di bidang kurikulum dan penilaian, kelembagaan dan sarana prasarana, serta peserta didik dan pembangunan karakter pendidikan anak usia dini dan pendidikan non formal;</li>\r\n<li>pelaksanaan koordinasi dengan unit kerja terkait;</li>\r\n<li>penyusunan laporan hasil pelaksanaan tugasnya; dan</li>\r\n<li>pelaksanaan fungsi lain yang diberikan oleh pimpinan terkait dengan tugas dan fungsinya.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"15\">\r\n<li><strong>Seksi Kurikulum dan Penilaian Pendidikan Anak Usia Dini dan Pendidikan Non Formal</strong></li>\r\n</ol>\r\n<ul>\r\n<li>Seksi Kurikulum dan Penilaian Pendidikan Anak Usia Dini dan Pendidikan Non Formal dipimpin oleh Kepala Seksi berada dibawah dan bertanggung jawab kepada Kepala Bidang Pendidikan Anak Usia Dini dan Pendidikan Non Formal.</li>\r\n<li>Seksi Kurikulum dan Penilaian Pendidikan Anak Usia Dini dan Pendidikan Non Formal sebagaimana dimaksud pada ayat (1) mempunyai tugas menyiapkan, merumuskan, mengkoordinasikan dan melaksanakan kebijakan kurikulum dan penilaian pendidikan anak usia dini dan pendidikan non formal.</li>\r\n<li>Seksi Kurikulum dan Penilaian Pendidikan Anak Usia Dini dan Pendidikan Non Formal dalam melaksanakan tugas sebagaimana dimaksud pada ayat (2) menyelenggarakan fungsi:</li>\r\n</ul>\r\n<ol>\r\n<li>penyusunan bahan perumusan, koordinasi pelaksanaan kebijakan kurikulum dan penilaian pendidikan anak usia dini dan pendidikan non formal;</li>\r\n<li>penyusunan bahan penetapan kurikulum muatan lokal dan kriteria penilaian pendidikan non formal;</li>\r\n<li>penyusunan bahan pembinaan pelaksanaan kurikulum dan penilaian pendidikan anak usia dini dan pendidikan non formal;</li>\r\n<li>penyusunan bahan pemantauan dan evaluasi pelaksanaan kurikulum dan penilaian pendidikan anak usia dini dan pendidikan non formal;</li>\r\n<li>pelaporan di bidang kurikulum dan penilaian pendidikan anak usia dini dan pendidikan non formal;</li>\r\n<li>pelaksanaan koordinasi dengan unit kerja terkait;</li>\r\n<li>penyusunan laporan hasil pelaksanaan tugasnya; dan</li>\r\n<li>pelaksanaan fungsi lain yang diberikan oleh pimpinan terkait dengan tugas dan fungsinya.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"16\">\r\n<li><strong>Seksi Sarana Prasarana Pendidikan Anak Usia Dini dan Pendidikan Non Formal</strong></li>\r\n</ol>\r\n<ul>\r\n<li>Seksi Kelembagaan dan Sarana Prasarana Pendidikan Anak Usia Dini dan Pendidikan Non Formal dipimpin oleh Kepala Seksi berada dibawah dan bertanggung jawab kepada Kepala Bidang Pendidikan Anak Usia Dini dan Pendidikan Non Formal.</li>\r\n<li>Seksi Kelembagaan dan Sarana Prasarana Pendidikan Anak Usia Dini dan Pendidikan Non Formal sebagaimana dimaksud pada ayat (1) mempunyai tugas menyiapkan, merumuskan, mengkoordinasikan dan melaksanakan kebijakan kelembagaan dan sarana prasarana pendidikan anak usia dini dan pendidikan non formal.</li>\r\n<li>Seksi Kelembagaan dan Sarana Prasarana Pendidikan Anak Usia Dini dan Pendidikan Non Formal dalam melaksanakan tugas sebagaimana dimaksud pada ayat (2) menyelenggarakan fungsi:</li>\r\n</ul>\r\n<ol>\r\n<li>penyusunan bahan perumusan, koordinasi pelaksanaan kebijakan kelembagaan dan sarana prasarana pendidikan anak usia dini dan pendidikan non formal;</li>\r\n<li>penyusunan bahan pembinaan kelembagaan dan sarana prasarana pendidikan anak usia dini dan pendidikan non formal;</li>\r\n<li>penyusunan bahan penyusunan bahan penerbitan izin pendirian, penataan, dan penutupan satuan pendidikan anak usia dini dan pendidikan non formal;</li>\r\n<li>penyusunan bahan pemantauan dan evaluasi kelembagaan dan sarana prasarana pendidikan anak usia dini dan pendidikan non formal; pelaporan di bidang kelembagaan dan sarana prasarana pendidikan anak usia dini dan pendidikan non formal;</li>\r\n<li>pelaksanaan koordinasi dengan unit kerja terkait;</li>\r\n<li>penyusunan laporan hasil pelaksanaan tugasnya; dan</li>\r\n<li>pelaksanaan fungsi lain yang diberikan oleh pimpinan terkait dengan tugas dan fungsinya.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"17\">\r\n<li><strong>Bidang Kebudayaan</strong></li>\r\n</ol>\r\n<p>Bidang Kebudayaan mempunyai tugas Melaksanakan penyiapan perumusan dan pelaksanaan kebijakan di bidang kebudayaan.</p>\r\n<p>Fungsi :</p>\r\n<ol>\r\n<li>penyusunan bahan perumusan dan koordinasi pelaksanaan kebijakan di bidang pengelolaan cagar budaya, pengelolaan museum provinsi, pembinaan sejarah, pelestarian tradisi, pembinaan komunitas dan lembaga adat, dan pembinaan kesenian;</li>\r\n<li>penyusunan bahan pembinaan di bidang pengelolaan cagar budaya, pengelolaan museum provinsi, pembinaan sejarah, pelestarian tradisi, pembinaan komunitas dan lembaga adat, dan pembinaan kesenian;</li>\r\n<li>penyusunan bahan pengelolaan kebudayaan yang masyarakat pelakunya lintas daerah kabupaten/kota dalam satu provinsi;</li>\r\n<li>penyusunan bahan pelestarian tradisi yang masyarakat penganutnya lintas daerah kabupaten/kota dalam satu provinsi;</li>\r\n<li>penyusunan bahan pembinaan komunitas dan lembaga adat yang masyarakat penganutnya lintas daerah kabupaten/kota dalam satu provinsi;</li>\r\n<li>penyusunan bahan pembinaan kesenian yang masyarakat pelakunya lintas daerah kabupaten/kota;</li>\r\n<li>penyusunan bahan pembinaan sejarah lokal provinsi;</li>\r\n<li>penyusunan bahan penetapan cagar budaya dan pengelolaan cagar budaya peringkat provinsi;</li>\r\n<li>penyusunan bahan penerbitan izin membawa cagar budaya ke luar provinsi;</li>\r\n<li>penyusunan bahan pengelolaan museum provinsi;</li>\r\n<li>penyusunan bahan fasilitasi di bidang pengelolaan cagar budaya, pengelolaan museum provinsi, pembinaan sejarah, pelestarian tradisi, pembinaan komunitas dan lembaga adat, dan pembinaan kesenian;</li>\r\n<li>penyusunan bahan pemantauan dan evaluasi di bidang pengelolaan cagar budaya, pengelolaan museum provinsi, pembinaan sejarah, pelestarian tradisi, pembinaan komunitas dan lembaga adat, dan pembinaan kesenian; dan</li>\r\n<li>pelaporan di bidang pengelolaan cagar budaya, pengelolaan museum provinsi, pembinaan sejarah, pelestarian tradisi, pembinaan komunitas dan lembaga adat, dan pembinaan kesenian.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"18\">\r\n<li><strong>Unit Pelaksana Teknis (UPT) Pendidikan Kecamatan</strong></li>\r\n</ol>\r\n<p><strong>&nbsp;</strong>Pembentukan Organisasi dan tata kerja Unit Pelaksana Teknis (UPT) dan Sekolah yang berfungsi sebagai pembantu Kepala SOPD yang bertugas di kecamatan. Dibentuk dan ditetapkan sesuai dengan peraturan perundang-undangan yang berlaku.</p>\r\n<p><strong>&nbsp;</strong>Unit Pelaksana Teknis Pendidikan terdiri dari 27 berkedudukan di tingkat kecamatan, dan 1 UPT Pendidikan SKB yang berkedudukan di ibu kota kabupaten.</p>\r\n<p>Dalam Kedudukannya :</p>\r\n<p><strong>&nbsp;</strong>Unit Pelaksana Teknis dipimpin oleh Kepala UPT, berada di bawah dan bertanggung jawab langsung kepada Kepala Dinas Pendidikan.</p>\r\n<ul>\r\n<li>Kepala UPT Pendidikan Kecamatan mempunyai tugas memimpin, mengkoordinasikan dan mengendalikan UPT dalam melaksanakn sebagian kegiatan di bidang pendidikan atau kegiatan penunjang Dinas.</li>\r\n<li>Dalam melaksanakan tugas sebagaimana dimaksud pada ayat UPT menyelenggarakan fungsi ;</li>\r\n</ul>\r\n<ol>\r\n<li>Menyusun program UPT Pendidikan Kecamatan;</li>\r\n<li>Pengumpulan dan pengolahan data kegiatan;</li>\r\n<li>Pelaksanaan kegiatan pembinaan dan pengembangan pendidikan;</li>\r\n<li>Pelaksanaan kegiatan teknis penunjang sesuai dengan lingkup tugasnya;</li>\r\n<li>Penyelenggaraan ketatausahaan UPT Pendidikan Kecamatan;</li>\r\n<li>Pengawasan dan pengendalian kegiatan;</li>\r\n<li>Penyusunan laporan kegiatan bidang tugasnya;</li>\r\n<li>Pelaksanaan tugas lain yang diberikan pimpinan sesuai tugas dan fungsinya.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"19\">\r\n<li><strong>Kelompok Jabatan Fungsional</strong></li>\r\n</ol>\r\n<ul>\r\n<li>Kelompok Jabatan Fungsional mempunyai tugas melaksanakan sebagian fungsi dinas sesuai dengan keahlian dan kebutuhan.</li>\r\n<li>Kelompok Jabatan Fungsional sebagaimana dimaksud pada ayat (1), terdiri dari sejumlah pegawai Negeri Sipil Daerah dalam jenjang jabatan fungsional yang terbagi dalam berbagai kelompok sesuai dengan bidang keahliannya.</li>\r\n<li>Jumlah Jabatan Fungsional ditentukan berdasarkan sifat, jenis kebutuhan dan beban kerja.</li>\r\n</ul>\r\n<p>Jenis dan jenjang Jabatan Fungsional sebagaimana dimaksud pada ayat (2), diatur sesuai dengan peraturan Perundang-undangan yang berlaku.</p>\r\n<p>&nbsp;</p>\r\n<p>Disusun oleh TUNING SUPRIYADI, M.Pd.</p>', NULL, 'Sub Pages', 'page', 17, 1, 4, '2026-01-16 21:49:02', '2026-02-03 02:21:34'),
