(22, 'Profil Pimpinan', 'profil-pimpinan', '<p><img class=\"alignnone size-full wp-image-536\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://dikbudrajaampat.serverjogja.com/wp-content/uploads/2021/12/Juariah-Saifudin.png\" sizes=\"(max-width: 524px) 100vw, 524px\" srcset=\"https://dikbudrajaampat.serverjogja.com/wp-content/uploads/2021/12/Juariah-Saifudin.png 524w, https://dikbudrajaampat.serverjogja.com/wp-content/uploads/2021/12/Juariah-Saifudin-295x300.png 295w\" alt=\"\" width=\"524\" height=\"532\"></p>\r\n<p style=\"text-align: center;\"><strong>Juariah Saifudin,SE.MM</strong></p>\r\n<p style=\"text-align: center;\"><strong>Kepala Dinas Pendidikan dan Kebudayaan Kabupaten Raja Ampat</strong></p>\r\n<p style=\"text-align: center;\"><strong>NIP. 19641012 198702 2 003</strong></p>', NULL, 'Sub Pages', 'page', 17, 1, 5, '2026-01-16 21:53:02', '2026-02-02 06:33:27'),
