INSERT INTO `posts` (`id`, `judul`, `slug`, `konten`, `gambar`, `kategori_id`, `user_id`, `status`, `views`, `tanggal_publish`, `created_at`, `updated_at`) VALUES
(1, 'Dinas Pendidikan Gelar Bimbingan Teknis Penggunaan Teknologi Pembelajaran', 'dinas-pendidikan-gelar-bimbingan-teknis-penggunaan-teknologi-pembelajaran', '<p data-start=\"2225\" data-end=\"2418\"><strong data-start=\"2225\" data-end=\"2239\">Raja Ampat</strong> &ndash; Dalam rangka meningkatkan kemampuan tenaga pendidik dalam memanfaatkan teknologi, Dinas Pendidikan Raja Ampat mengadakan bimbingan teknis penggunaan media pembelajaran digital.</p>\r\n<p data-start=\"2420\" data-end=\"2600\">Kegiatan ini memberikan pelatihan penggunaan aplikasi pembelajaran, pembuatan materi interaktif, serta pemanfaatan platform daring sebagai sarana pendukung proses belajar mengajar.</p>', 'file-manager/HEV1SBtJn0jmqdtuJTAJOmEQZZX5FzmKvSreJic9.jpg', 1, 1, 'published', 28, '2026-01-13 03:48:27', '2026-01-13 03:48:27', '2026-02-06 03:52:57'),
(2, 'Kunjungan Tim Pengawas Pendidikan untuk Monitoring Proses Pembelajaran', 'kunjungan-tim-pengawas-pendidikan-untuk-monitoring-proses-pembelajaran', '<p data-start=\"1741\" data-end=\"1996\"><strong data-start=\"1741\" data-end=\"1755\">Raja Ampat</strong> &ndash; Tim pengawas dari Dinas Pendidikan Kabupaten Raja Ampat melakukan kunjungan ke beberapa sekolah guna memantau pelaksanaan proses pembelajaran. Kegiatan ini bertujuan memastikan kegiatan belajar mengajar berjalan sesuai standar pendidikan.</p>\r\n<p data-start=\"1998\" data-end=\"2132\">Selain melakukan monitoring, tim pengawas juga memberikan pendampingan kepada guru terkait peningkatan kualitas pembelajaran di kelas.</p>', 'file-manager/VhB5Gs2rQGj8QINWvbwMYYn6ZSLNpPT57ZXOR6eX.jpg', 1, 1, 'published', 3, '2026-01-21 05:55:07', '2026-01-19 02:37:01', '2026-02-06 03:52:24'),
(3, 'Peningkatan Literasi Siswa Melalui Program Gerakan Membaca Pagi', 'peningkatan-literasi-siswa-melalui-program-gerakan-membaca-pagi', '<p data-start=\"248\" data-end=\"493\"><strong data-start=\"248\" data-end=\"262\">Raja Ampat</strong> &ndash; Dalam upaya meningkatkan budaya literasi di kalangan pelajar, beberapa sekolah di Kabupaten Raja Ampat mulai menerapkan program Gerakan Membaca Pagi. Kegiatan ini dilaksanakan selama 15 menit sebelum proses pembelajaran dimulai.</p>\r\n<p data-start=\"495\" data-end=\"769\">Kepala Dinas Pendidikan Raja Ampat menyampaikan bahwa program ini bertujuan menumbuhkan minat baca serta meningkatkan kemampuan pemahaman siswa terhadap berbagai jenis bacaan. Para siswa terlihat antusias mengikuti kegiatan tersebut dengan membawa buku bacaan masing-masing.</p>\r\n<p data-start=\"771\" data-end=\"1001\">Guru dan tenaga pendidik juga turut mendampingi serta memberikan motivasi kepada siswa agar terus mengembangkan kebiasaan membaca. Diharapkan program ini dapat membentuk karakter siswa yang gemar belajar dan memiliki wawasan luas.</p>', 'file-manager/F43b42CTG609vYXKJWPOePUtmtP779wHbA5MZwxr.jpg', 1, 3, 'published', 0, '2026-02-06 03:15:52', '2026-02-06 03:15:52', '2026-02-06 03:15:52'),
(4, 'Sekolah Adakan Program Peduli Lingkungan Melalui Penanaman Pohon', 'sekolah-adakan-program-peduli-lingkungan-melalui-penanaman-pohon', '<p data-start=\"2495\" data-end=\"2686\"><strong data-start=\"2495\" data-end=\"2509\">Raja Ampat</strong> &ndash; Dalam rangka menanamkan kepedulian terhadap lingkungan, beberapa sekolah di Kabupaten Raja Ampat melaksanakan kegiatan penanaman pohon di area sekolah dan lingkungan sekitar.</p>\r\n<p data-start=\"2688\" data-end=\"2854\">Kegiatan ini melibatkan siswa, guru, serta masyarakat setempat. Selain menanam pohon, siswa juga diberikan edukasi mengenai pentingnya menjaga kelestarian lingkungan.</p>\r\n<p data-start=\"2856\" data-end=\"3005\">Program ini diharapkan mampu membentuk generasi muda yang memiliki kesadaran terhadap pelestarian alam serta menjaga keindahan lingkungan Raja Ampat.</p>', 'file-manager/0r6alUWo6DBdSyro0IgsJKXg6XkYxL49tthuOPDd.jpg', 3, 3, 'published', 0, '2026-02-06 03:16:35', '2026-02-06 03:16:35', '2026-02-06 03:16:35'),
(5, 'Kegiatan Ekstrakurikuler Dorong Pengembangan Bakat dan Karakter Siswa', 'kegiatan-ekstrakurikuler-dorong-pengembangan-bakat-dan-karakter-siswa', '<p data-start=\"1819\" data-end=\"2079\"><strong data-start=\"1819\" data-end=\"1833\">Raja Ampat</strong> &ndash; Berbagai sekolah di Raja Ampat terus mengembangkan kegiatan ekstrakurikuler sebagai sarana pembentukan karakter dan pengembangan bakat siswa. Kegiatan yang diselenggarakan antara lain olahraga, seni budaya, pramuka, dan kegiatan ilmiah remaja.</p>\r\n<p data-start=\"2081\" data-end=\"2263\">Para siswa menunjukkan semangat tinggi dalam mengikuti kegiatan tersebut. Selain melatih keterampilan, ekstrakurikuler juga menanamkan nilai kerja sama, disiplin, dan tanggung jawab.</p>\r\n<p data-start=\"2265\" data-end=\"2411\">Pihak sekolah berharap kegiatan ini dapat membantu siswa mengembangkan potensi diri serta meningkatkan prestasi di tingkat daerah maupun nasional.</p>', 'file-manager/DkWxIVubwiVq09HBAafazjKVHABFo2HKKblPv9PW.jpg', 1, 3, 'published', 0, '2026-02-06 03:17:19', '2026-02-06 03:17:19', '2026-02-06 03:17:19'),
(6, 'Lomba Seni dan Budaya Antar Sekolah Tingkat SD Digelar untuk Melestarikan Budaya Daerah', 'lomba-seni-dan-budaya-antar-sekolah-tingkat-sd-digelar-untuk-melestarikan-budaya-daerah', '<p data-start=\"2666\" data-end=\"2905\"><strong data-start=\"2666\" data-end=\"2680\">Raja Ampat</strong> &ndash; Dinas Pendidikan Raja Ampat mengadakan lomba seni dan budaya antar sekolah tingkat SD sebagai upaya melestarikan budaya lokal. Lomba tersebut menampilkan berbagai pertunjukan tari tradisional, musik daerah, dan seni kriya.</p>\r\n<p data-start=\"2907\" data-end=\"3020\">Kegiatan ini mendapat sambutan positif dari masyarakat dan menjadi sarana pengenalan budaya kepada generasi muda.</p>', 'file-manager/hUH9SANDxXNAe6G3E8TAZGdLOaGEyGBqTV4cIPCr.jpg', 3, 3, 'published', 0, '2026-02-06 03:25:51', '2026-02-06 03:25:51', '2026-02-06 03:25:51'),
(7, 'Dinas Pendidikan Gelar Pelatihan Pengelolaan Administrasi Sekolah', 'dinas-pendidikan-gelar-pelatihan-pengelolaan-administrasi-sekolah', '<p data-start=\"2180\" data-end=\"2466\"><strong data-start=\"2180\" data-end=\"2194\">Raja Ampat</strong> &ndash; Dalam rangka meningkatkan tertib administrasi sekolah, Dinas Pendidikan Raja Ampat menyelenggarakan pelatihan pengelolaan administrasi bagi tenaga kependidikan. Pelatihan ini mencakup pengelolaan data siswa, laporan kegiatan, serta sistem administrasi berbasis digital.</p>\r\n<p data-start=\"2468\" data-end=\"2559\">Kegiatan ini diharapkan dapat meningkatkan efisiensi dan akuntabilitas pengelolaan sekolah.</p>', 'file-manager/Elz1YlPp4fQGR4weP5QS7k5kWzfDl9Gv8BSdUoNK.jpg', 3, 3, 'published', 0, '2026-02-06 03:26:32', '2026-02-06 03:26:32', '2026-02-06 03:26:32'),
(8, 'Kunjungan Kerja Pejabat Pendidikan Provinsi Papua Barat Daya ke Sekolah di Raja Ampat', 'kunjungan-kerja-pejabat-pendidikan-provinsi-papua-barat-daya-ke-sekolah-di-raja-ampat', '<p data-start=\"1707\" data-end=\"1953\"><strong data-start=\"1707\" data-end=\"1721\">Raja Ampat</strong> &ndash; Pejabat Dinas Pendidikan Provinsi Papua Barat Daya melakukan kunjungan kerja ke sejumlah sekolah di Kabupaten Raja Ampat. Kunjungan ini bertujuan memantau pelaksanaan program pendidikan serta kondisi sarana dan prasarana sekolah.</p>\r\n<p data-start=\"1955\" data-end=\"2095\">Dalam kesempatan tersebut, pejabat pendidikan juga berdialog langsung dengan guru dan siswa untuk mengetahui kebutuhan pendidikan di daerah.</p>', 'file-manager/kHN7ZNQMDrKxjy1lePTzZ443PdBb2vYAbyYXcAi2.jpg', 3, 1, 'published', 1, '2026-02-06 03:28:42', '2026-02-06 03:28:42', '2026-02-06 03:30:27'),
(9, 'Siswa Raja Ampat Raih Juara Olimpiade Sains Tingkat Provinsi', 'siswa-raja-ampat-raih-juara-olimpiade-sains-tingkat-provinsi', '<p data-start=\"1235\" data-end=\"1481\"><strong data-start=\"1235\" data-end=\"1249\">Raja Ampat</strong> &ndash; Prestasi membanggakan diraih oleh salah satu siswa SMA di Kabupaten Raja Ampat yang berhasil meraih juara dalam Olimpiade Sains tingkat provinsi. Keberhasilan ini menjadi bukti meningkatnya kualitas pendidikan di daerah tersebut.</p>\r\n<p data-start=\"1483\" data-end=\"1602\">Dinas Pendidikan memberikan apresiasi serta dukungan agar siswa dapat terus mengembangkan prestasi di tingkat nasional.</p>', 'file-manager/eGIa0OGtwm4Ta0XPap0VhbRSuMrnbvLl76Dhz5yy.jpg', 3, 1, 'published', 0, '2026-02-06 03:29:17', '2026-02-06 03:29:17', '2026-02-06 03:29:17'),
(10, 'Dinas Pendidikan Raja Ampat Gelar Workshop Peningkatan Kompetensi Guru', 'dinas-pendidikan-raja-ampat-gelar-workshop-peningkatan-kompetensi-guru', '<p data-start=\"232\" data-end=\"513\"><strong data-start=\"232\" data-end=\"246\">Raja Ampat</strong> &ndash; Dinas Pendidikan Kabupaten Raja Ampat menyelenggarakan workshop peningkatan kompetensi guru yang diikuti oleh tenaga pendidik dari berbagai jenjang sekolah. Kegiatan ini bertujuan meningkatkan kualitas pembelajaran serta penguasaan metode pengajaran yang inovatif.</p>\r\n<p data-start=\"515\" data-end=\"681\">Dalam kegiatan tersebut, para peserta mendapatkan pelatihan mengenai strategi pembelajaran aktif, pemanfaatan teknologi, serta penyusunan perangkat ajar yang efektif.</p>\r\n<p data-start=\"515\" data-end=\"681\">&nbsp;</p>', 'file-manager/BXDCuqWnxqBCPstdxCZIvUPEu2j1D6MqArU1Pajp.jpg', 3, 1, 'published', 0, '2026-02-06 03:30:05', '2026-02-06 03:30:05', '2026-02-06 03:30:05'),
(11, 'Dinas Pendidikan Raja Ampat Gelar Sosialisasi Kurikulum Merdeka', 'dinas-pendidikan-raja-ampat-gelar-sosialisasi-kurikulum-merdeka', '<p data-start=\"203\" data-end=\"515\"><strong data-start=\"203\" data-end=\"217\">Raja Ampat</strong> &ndash; Dinas Pendidikan Kabupaten Raja Ampat mengadakan kegiatan sosialisasi Kurikulum Merdeka kepada para kepala sekolah dan guru dari berbagai jenjang pendidikan. Kegiatan ini bertujuan memberikan pemahaman terkait implementasi kurikulum yang menekankan pembelajaran berbasis kompetensi dan karakter.</p>\r\n<p data-start=\"517\" data-end=\"694\">Dalam kegiatan tersebut, peserta mendapatkan materi mengenai penyusunan modul ajar, asesmen pembelajaran, serta strategi penerapan pembelajaran yang lebih fleksibel dan kreatif.</p>', 'file-manager/lpT8DT6HHjQ55lasD8zIdSpTxyiQ0iiDtj6wCCOz.jpg', 3, 1, 'published', 0, '2026-02-06 03:50:38', '2026-02-06 03:50:38', '2026-02-06 03:50:38'),
(12, 'Lomba Futsal Antar Sekolah Tingkat SMA Tingkatkan Sportivitas Pelajar', 'lomba-futsal-antar-sekolah-tingkat-sma-tingkatkan-sportivitas-pelajar', '<p data-start=\"783\" data-end=\"1055\"><strong data-start=\"783\" data-end=\"797\">Raja Ampat</strong> &ndash; Dinas Pendidikan Raja Ampat menyelenggarakan lomba futsal antar sekolah tingkat SMA yang diikuti oleh sejumlah sekolah dari berbagai distrik. Kegiatan ini bertujuan meningkatkan kebugaran jasmani serta menumbuhkan semangat sportivitas di kalangan pelajar.</p>\r\n<p data-start=\"1057\" data-end=\"1181\">Pertandingan berlangsung meriah dengan dukungan para guru dan siswa yang hadir memberikan semangat kepada tim masing-masing.</p>', 'file-manager/PcFGrlXTAmk9Fi9uiIFddhg4zhgPzR6rtL3anzlh.jpg', 3, 1, 'published', 1, '2026-02-06 03:51:14', '2026-02-06 03:51:14', '2026-02-06 04:01:14'),
(13, 'Siswa Raja Ampat Raih Juara Lomba Pidato Bahasa Indonesia', 'siswa-raja-ampat-raih-juara-lomba-pidato-bahasa-indonesia', '<p data-start=\"1258\" data-end=\"1530\"><strong data-start=\"1258\" data-end=\"1272\">Raja Ampat</strong> &ndash; Salah satu siswa SMP di Kabupaten Raja Ampat berhasil meraih juara dalam lomba pidato Bahasa Indonesia tingkat provinsi. Keberhasilan ini menunjukkan kemampuan siswa dalam mengembangkan keterampilan berbahasa serta percaya diri dalam menyampaikan gagasan.</p>\r\n<p data-start=\"1532\" data-end=\"1651\">Dinas Pendidikan memberikan penghargaan kepada siswa berprestasi tersebut sebagai bentuk motivasi bagi pelajar lainnya.</p>\r\n<p data-start=\"1532\" data-end=\"1651\">&nbsp;</p>', 'file-manager/gtzyCQ78VSFDWYndQbtkWniCf8YbcbBPHvq5GNGH.jpg', 3, 1, 'published', 0, '2026-02-06 03:51:48', '2026-02-06 03:51:48', '2026-02-06 03:51:48');
